import 'package:json_annotation/json_annotation.dart';part 'rating_summary_model.g.dart';@JsonSerializable()class RatingSummaryModel {  @JsonKey(name: 'rating_total')  final int? ratingTotal;  @JsonKey(name: 'rating_count')  final List<int>? ratingCount;  @JsonKey(name: 'rcount_with_context')  final int? ratingCountWithContext;  @JsonKey(name: 'rcount_with_image')  final int? ratingCountWithImage;  const RatingSummaryModel({    this.ratingTotal,    this.ratingCount,    this.ratingCountWithContext,    this.ratingCountWithImage,  });  factory RatingSummaryModel.fromJson(Map<String, dynamic> json) =>      _$RatingSummaryModelFromJson(json);  Map<String, dynamic> toJson() => _$RatingSummaryModelToJson(this);}